import React, { useEffect} from 'react';
import { Link} from 'react-router-dom';

function HomePage(props) {

    useEffect(()=>{
        fetch('http://192.168.48.50:3000/',{
            mode:'no-cors'
        })
        .then(res=>res.json())
        .then(results=>{
            console.log(results)
        })
    })

    return (
        <div>
            <Link to={{
            pathname:"/about",
            data:{
                Name:"Keshav Garg",
                Edu:"NITH"
            }
            }}>Banking System</Link>
        </div>
    );
}

export default HomePage;
